import PropTypes from 'prop-types';
import '../styles/Navbar.scss'
import Link from 'next/link'

const NavLink = props => (
    <Link href="/list/[id]" as={`/list/${props.id}`} title={props.children.title}>
        <a>{props.children}</a>
    </Link>
)

const Navbar = (props) => (
<div id="nav">
    <a href="#" className="closeBtn" onClick={props.onCloseNav}>
        &times;
    </a>
    <div className="overlay-content">
        <Link href="/" as={"/home"}>
            <a>Home</a>
        </Link>
        <NavLink id="catalogs" title="Catalogs">Catalogs</NavLink>
        <NavLink id="cars" title="Cars">Cars</NavLink>
        <NavLink id="create-catalog" title="Create a Catalog">Create a Catalog</NavLink>
        <NavLink id="create-car" title="Create a Car">Create a Car</NavLink>
    </div>
</div>
);

Navbar.propTypes = {
    onCloseNav: PropTypes.func
}
export default Navbar;
